import { Outlet } from "react-router-dom";

const Encabezado = () => {
    return ( 
        <div>
            <nav className="navbar">
            <header className="header">
                 <h1 className="modal-title">Discos</h1>
            </header>
            
        </nav>
            <main>
                <Outlet/>
            </main>
        </div>
     );
}
 
export default Encabezado;
